Рели́гия (через польск. religia, от лат. religiō — «связанность клятвой, верой»; «святыня», «благочестие», от religare — «связывать», от ligare — «связывать») — определённая система взглядов, обусловленная верой в сверхъестественное, включающая в себя свод моральных норм и типов поведения, обрядов, культовых действий и объединение людей в организацию (Церковь, умма, сангха, религиозная община). Другие определения религии: 
* исповедание веры посредством внешних знаков; 
* организованное поклонение высшим силам. Религия не только представляет собой веру в существование высших сил, но устанавливает особые отношения к этим силам, она есть, следовательно, известная деятельность воли, направленная к этим силам; 
* духовная формация, особый тип отношения человека к миру и самому себе, обусловленный представлениями об инобытии как доминирующей по отношению к обыденному существованию реальности; 
* система человеческих норм и ценностей, основанных на вере в высший, сверхчеловеческий порядок. Также термин «религия» может пониматься в таких смыслах, как субъективно-личностный (религия как индивидуальная «вера», «религиозность») и объективно-общий (религия в качестве институционального явления — «вероисповедания», «богопочитания», «конфессии»). Религиозная система представления мира (мировоззрение) опирается на религиозную веру и связана с отношением человека к надчеловеческому духовному миру, сверхчеловеческой реальности, о которой человек что-то знает, и на которую он ориентирует свою жизнь. Вера может подкрепляться мистическим опытом. Особую важность для религии представляют такие понятия, как добро и зло, нравственность, цель и смысл жизни. Основы религиозных представлений большинства мировых религий записаны людьми в священных текстах, которые, по убеждению верующих, либо продиктованы или вдохновлены непосредственно Богом или богами, либо написаны людьми, достигшими с точки зрения каждой конкретной религии высшего духовного состояния, великими учителями, особо просветлёнными или посвящёнными, святыми. В большинстве религиозных сообществ заметное место занимает духовенство (служители религиозного культа). Религия является преобладающим мировоззрением в большинстве стран, большинство опрошенных относят себя к одному из вероисповеданий.
